import React from 'react'
import { View } from 'react-native'
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs'
import FontIcon from 'react-native-vector-icons/FontAwesome5'
import { getFocusedRouteNameFromRoute } from '@react-navigation/native'
import { colors } from 'theme'

// stack navigators
import {
  HomeNavigator, ChatNavigator, MatchesNavigator, ProfileNavigator,
// eslint-disable-next-line import/named
} from '../stacks'

const Tab = createBottomTabNavigator()

const TabNavigator = () => (
  <Tab.Navigator
    screenOptions={({ route }) => ({
      // eslint-disable-next-line react/prop-types
      tabBarIcon: ({ focused }) => {
        switch (route.name) {
          case 'Explore':
            return (
              <FontIcon
                name="search"
                color={focused ? colors.semiOrange : colors.grey}
                size={20}
                solid
              />
            )
          case 'Chat':
            return (
              <FontIcon
                name="chat"
                color={focused ? colors.semiOrange : colors.grey}
                size={20}
                solid
              />
            )
          case 'Matches':
            return (
              <FontIcon
                name="hand-holding-heart"
                color={focused ? colors.semiOrange : colors.grey}
                size={20}
                solid
              />
            )
          case 'Profile':
            return (
              <FontIcon
                name="user"
                color={focused ? colors.semiOrange : colors.grey}
                size={20}
                solid
              />
            )
          default:
            return <View />
        }
      },
    })}
    tabBarOptions={{
      activeTintColor: colors.semiOrange,
      inactiveTintColor: colors.grey,
    }}
    initialRouteName="StartPage"
    swipeEnabled={false}
  >
    <Tab.Screen
      name="Explore"
      component={HomeNavigator}
      options={({ route }) => ({
        tabBarVisible: ((route) => {
          const routeName = getFocusedRouteNameFromRoute(route)

          return !(routeName === 'StartPage'
            || routeName === 'LoginForm'
            || routeName === 'SignUpForm')
        })(route),
      })}
    />
    <Tab.Screen name="Chat" component={ChatNavigator} />
    <Tab.Screen name="Matches" component={MatchesNavigator} />
    <Tab.Screen name="Profile" component={ProfileNavigator} />
  </Tab.Navigator>
)

export default TabNavigator
